import styles from "./Home.module.css"

function Home () {
    return (
        <section className = {styles.home_container}>
            <h1>Bem vindo ao <span>Urubu do Pix!</span></h1>
            <h4>Comece agora a expandir seus lucros com ganhos inimagináveis!!</h4>
            <p>Nada nesse site deve ser levado a sério, sendo apenas um projeto para fixação dos aprendizados!!</p>
        </section>
    )
}

export default Home
